import { Link } from "react-router-dom";
import axios from "axios";
import React, { useEffect, useState } from "react";
import Nav from "./Nav";
import io from "socket.io-client";

const socket = io.connect(":8000");
const Home = () => {
  const [voting, setVoting] = useState([]);
  const [voting1, setVoting1] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:8000/api/voting/")
      .then((res) => {
        console.log(res);
        setVoting(res.data.votes);
      })
      .catch((err) => console.error(err));
        socket.on("setVotes", (data) => {

          console.log("set votes data", data);
          axios
            .get("http://localhost:8000/api/voting/")
            .then((res) => {
              console.log(res);
             /// setVote(res.data.vote);
                 setVoting(res.data.votes);
            })
            .catch((err) => console.error(err));

          // let a = [];
          // for (let i in data) {
          //   a.push(data[i]);
          // }
          // setBtns(a);
          // console.log("btns", btns);
        });
  }, []);

    useEffect(() => {
      axios
        .get("http://localhost:8000/api/votes/")
        .then((res) => {
          console.log(res);
          setVoting1(res.data.votes);
        })
        .catch((err) => console.error(err));
      socket.on("setVotes", (data) => {
        console.log("set votes data", data);
        axios
          .get("http://localhost:8000/api/voting/")
          .then((res) => {
            console.log(res);
            /// setVote(res.data.vote);
            setVoting(res.data.pet);
          })
          .catch((err) => console.error(err));

      });
    }, []);

  return (
    <div className="container">
      <Nav />
      <div className="d-flex justify-content-end">
        <Link to="/new" className="btn btn-outline-dark m-2">
          Add Your own poll
        </Link>
      </div>
      <div className="row">
        <div className="col border m-2 p-2 bg-secondary">
          <h1 className="text-white">Top 3 Polls</h1>
          {voting1.map((vote, idx) => (
            <div className="card-container border m-3 p-2 bg-white" key={idx}>
              <div>
                <div>
                  <Link to={`/${vote._id}`}>
                    <p className="m-2 h6">{vote.question}</p>
                  </Link>
                  <p className="m-2 h6">
                    {vote[1].opName} {vote[1].value}
                  </p>
                  <p className="m-2 h6">
                    {vote[2].opName} {vote[2].value}
                  </p>
                  {vote[3].opName !== "" ? (
                    <p className="m-2 h6">
                      {vote[3].opName} {vote[3].value}
                    </p>
                  ) : null}
                  {vote[4].opName !== "" ? (
                    <p className="m-2 h6">
                      {vote[4].opName} {vote[4].value}
                    </p>
                  ) : null}
                  <p className="m-2 h6">{vote.createdAt}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
        <div className="col border m-2 p-2 bg-secondary">
          <h1 className="text-white">Recent Polls</h1>
          {voting.map((vote, idx) => (
            <div className="card-container border m-3 p-2 bg-white" key={idx}>
              <div>
                <div>
                  <Link to={`/${vote._id}`}>
                    <p className="m-2 h6">{vote.question}</p>
                  </Link>
                  <p className="m-2 h6">
                    {vote[1].opName} {vote[1].value}
                  </p>
                  <p className="m-2 h6">
                    {vote[2].opName} {vote[2].value}
                  </p>
                  {vote[3].opName !== "" ? (
                    <p className="m-2 h6">
                      {vote[3].opName} {vote[3].value}
                    </p>
                  ) : null}
                  {vote[4].opName !== "" ? (
                    <p className="m-2 h6">
                      {vote[4].opName} {vote[4].value}
                    </p>
                  ) : null}
                  <p className="m-2 h6">{vote.createdAt}</p>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Home;
